import { getListOfMasters } from "../../services/createTopic-services";

const list = await getListOfMasters();

const ListOfMasters = () => {

    return(list.map((value, index) => {
        return(<div key={index} className="masterBox">
            <div className="masterCard">
                {value.name}
            </div>
            <div className="masterAction">
                <button>Написать соощение </button>
                <button>Предложить заказ</button>
                <div className="masterLocation">
                    <a>Регион-</a>
                    <p>Москва и Мо</p>
                </div>
            </div>
        </div>);
    }));
}

export default ListOfMasters;
